webpackJsonp([30050278057135],{1155:function(A,e){A.exports={data:{nodePost:{title:"Intentional Home Improvements",body:{value:"<p>New Year's resolution time!</p>\r\n<p>Things felt a little different heading into 2019. I usually have a pretty good handle on what I want to accomplish in the upcoming year, along with a formal resolution. But this year, nothing. Initially that seemed terrifying, but the more I think about it, that openness and lack of expectation is an exciting resolution in and of itself.</p>\r\n<p>Standing in my now <em>mostly</em> finished kitchen I also came up with another late breaking resolution. 2019 is going to be the year of intentional home improvements. Rather than letting a flood force me into it, I'm going to try to proactively decorate, improve and declutter. It is pleasantly (mostly) non-technical, and I can tackle it in tiny chunks throughout the year.</p>\r\n<p>Wishing everyone a happy and productive 2019 full of dry kitchens.</p> "},relationships:{image:{localFile:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.3325545171339563,src:"/static/bc4109a22f50873da49408b523d0a915-ee8d7cc9338c16ed2c4b9bc8817e39b9-42807.jpg",srcSet:"/static/bc4109a22f50873da49408b523d0a915-ee8d7cc9338c16ed2c4b9bc8817e39b9-960f9.jpg 313w,\n/static/bc4109a22f50873da49408b523d0a915-ee8d7cc9338c16ed2c4b9bc8817e39b9-c36f2.jpg 625w,\n/static/bc4109a22f50873da49408b523d0a915-ee8d7cc9338c16ed2c4b9bc8817e39b9-42807.jpg 1250w,\n/static/bc4109a22f50873da49408b523d0a915-ee8d7cc9338c16ed2c4b9bc8817e39b9-dbc5e.jpg 1875w,\n/static/bc4109a22f50873da49408b523d0a915-ee8d7cc9338c16ed2c4b9bc8817e39b9-6e234.jpg 2500w,\n/static/bc4109a22f50873da49408b523d0a915-ee8d7cc9338c16ed2c4b9bc8817e39b9-98489.jpg 3422w",sizes:"(max-width: 1250px) 100vw, 1250px"}}}}},created:1546524528}},pathContext:{slug:"/post/intentional-home-improvements/"}}}});
